import './FAbout.css';


const FAbout = () => {
  return (
    <div>
    <section className="hero-section2">
    
      <div className="overlay2">
        <p className="absolute right-80 text-black  font-serif text-xl">
        Hey there! It's Ayoub Rahim here, an Architect, Interior designer and 3d visualizer with experience of over 5 years in this field
As an expert in this field from the last few years, I've been providing my services to individuals and organizations.
I transform architectural designs into stunning visual representations. I specialize in Interior Design, 3D modeling, 3D Visualization and Walkthrough Animations. Using advanced software and artistic techniques, I create realistic 3D renderings, animations, and virtual reality experiences that bring architectural concepts to life.
        </p><img src="logo/1.png" className="absolute top-44 left-0 h-[370px] w-auto m-4" alt="logo" />
      </div>
    </section>
  </div>
  );
};

export default  FAbout;
